import React from 'react';
import './About.css';
import { Button } from './Button';

function AboutContent() {
  return (
    <div className='hero-container'>
      <h1>About</h1>
      <p><p>
              Indonesia is ranked as the world's No. 6 most beautiful country compiled by the London-based travel guide website Rough Guides, making it the best among Asian countries. According to the results of voting submitted by Rough
              Guides readers, Indonesia was famous for myriad of islands and volcanoes that span across its vast territory. The nation was also rich in cultural heritages from ethnic groups inhabiting thousands of islands in the country. In
              the voting process, Indonesia left behind two other Asian countries voted by readers, India and Vietnam, at ranks of 13 and 20 respectively.
            </p></p>
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          GET STARTED
        </Button>
        <Button
          className='btns'
          buttonStyle='btn--primary'
          buttonSize='btn--large'
          onClick={console.log('hey')}
        >
          WATCH TRAILER <i className='far fa-play-circle' />
        </Button>
      </div>
    </div>
  );
}

export default AboutContent;
